import Nav from "../component/Nav";
import about from '../style/about.module.css'

console.log(about);
export default function Index() {
    return (
        <div className="container">
            <Nav/>
            <main className={about.main}>
                <button className={about.button}/>
            </main>
        </div>
    );
}
